import React, { useState, useEffect } from "react";

import "./Checkbox.css";

const Checkbox = ({ checked, onChange }) => {
  return (
    <div className="round">
      <input type="checkbox" checked={checked} onChange={onChange} />
      <label
        className={`checkbox ${checked ? "checkbox--active" : ""}`}
        htmlFor="checkbox"
      ></label>
    </div>
  );
};

export default Checkbox;
